import "./Nav.css";
const Navigation = (props) => {
  return (
    <>
      <div className="navbar">
        <div className="logo">
          <img src="./logo.png" width="50px" height="50px" alt="" />
        </div>
      </div>
    </>
  );
};

export default Navigation;
